.highlight.linter-warning .region {
  background: linear-gradient(to bottom, #f99157 0%, rgba(249, 145, 87, 0.30000000000000004) 20%, rgba(249, 145, 87, 0.30000000000000004) 80%, #f99157 100%);
  border-left: 2px solid #f99157;
  border-right: 2px solid #f99157;
}
.highlight.linter-error .region {
  background: linear-gradient(to bottom, #f2777a 0%, rgba(242, 119, 122, 0.30000000000000004) 20%, rgba(242, 119, 122, 0.30000000000000004) 80%, #f2777a 100%);
  border-left: 2px solid #f2777a;
  border-right: 2px solid #f2777a;
}
